webpackJsonp([0xbac775b132fc],{8798:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Sebrenica",date:"11 Jul 2003",slug:"/2003-07-11-sebrenica/",tags:"Y2003"},html:'<p><a title="VERFLIXT UND ZUGENEWST !" href="http://babble.antville.org/stories/447590/">Godany</a> reminded me that today is the 8th anniversary of the massacre at <a title="Srebrenica Campaign Page" href="http://www.advocacynet.org/cpage_view/srebrenica_03_18_88.html">Srebrenica</a>, and points to a <a title="Wired News: Bloggers Opening Western Eyes" href="http://www.wired.com/news/culture/0,1284,59557,00.html">story at Wired</a> on weblogs at <a title="The Advocacy Project" href="http://www.advocacynet.org/index.html">The Advocacy Project</a>. <a href="http://www.steffanie.net/blog/">Steffanie</a> might be interested in the <a title="Kosovo Campaign Page" href="http://www.advocacynet.org/cpage_view/kosovo_summary_3_6.html">weblog from Kosovo</a>.</p>'},next:{fields:{title:"hamburg.blogplan.de",date:"11 Jul 2003",slug:"/2003-07-11-hamburg-blogplan-de/"}},previous:{fields:{title:"All roads lead...",date:"13 Jul 2003",slug:"/2003-07-13-all-roads-lead/"}}},{node:{fields:{title:"hamburg.blogplan.de",date:"11 Jul 2003",slug:"/2003-07-11-hamburg-blogplan-de/",tags:"Y2003"},html:'<p><a href="http://hamburg.blogplan.de/"><img alt="blogplan.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2003/07/blogplan.jpg" width="175" height="147" border="0" align="right" /></a>Thanks to <a href="http://lumma.de">Nico\'s</a> intern <a href="http://wiesel.h-blog.org/">Sven</a>, we bloggers in Hamburg now have a <a href="http://hamburg.blogplan.de/">blogplan</a>, where we can track each other by the nearest U/S-Bahn station. Over 50 blogs have been entered.</p>\n<p>I actually live quite a ways south of Hittfeld, but Buchholz isn\'t in the Hamburg transit system (yet). I work at station St. Pauli, my wife\'s office is near Mundsburg, and our first apartment in Hamburg was exactly halfway between Barmbek and Alter Teichweg.</p>'},next:{fields:{title:"Washington Times: Crash caused Lynch's 'horrific injuries'",date:"09 Jul 2003",slug:"/2003-07-09-washington-times-crash-caused-lynchs-horrific-injuries/"}},previous:{fields:{title:"Sebrenica",date:"11 Jul 2003",slug:"/2003-07-11-sebrenica/"}}},{node:{fields:{title:"Washington Times: Crash caused Lynch's 'horrific injuries'",date:"09 Jul 2003",slug:"/2003-07-09-washington-times-crash-caused-lynchs-horrific-injuries/",tags:"Y2003"},html:'<p><a title="Iraqi doctors saved her life" href="http://washingtontimes.com/national/20030709-121049-4754r.htm">Washington Times: Crash caused Lynch\'s \'horrific injuries\'</a></p>'},next:{fields:{title:"Beyond T9",date:"09 Jul 2003",slug:"/2003-07-09-beyond-t9/"}},previous:{fields:{title:"hamburg.blogplan.de",date:"11 Jul 2003",slug:"/2003-07-11-hamburg-blogplan-de/"}}}],pathPrefix:"",first:!1,last:!1,index:682,pageCount:1101}}}});
